import React, {Component} from "react";
import "./library.css"

// This is how a function component takes props.
const Module = (props) =>
    React.createElement("div", { className: `box ${props.darkMode}` },
        React.createElement("h1", { className: "title" }, props.title),
        React.createElement("p", null, props.content));



// This Class component also can have props
class Library extends Component {
    render() {

        return React.createElement("div", null,
            React.createElement("h1", { class: "subtitle" },
                this.props.header),

            React.createElement(Module, {
                darkMode: "false",
                title: "Light",
                content: "Lorem ipsum dolor sit amet, consectetur adipiscing elit, sed do eiusmod tempor incididunt ut labore et dolore magna aliqua." }),

            React.createElement(Module, {
                darkMode: "dark-mode",
                title: "Dark",
                content: "Ut enim ad minim veniam, quis nostrud exercitation ullamco laboris nisi ut aliquip ex ea commodo consequat. Duis aute irure dolor in reprehenderit in voluptate velit esse cillum dolore eu fugiat nulla pariatur." }));


    }
}

export default Library;
